INSERT INTO `commit` VALUES (62,'411746babf59587634d513261e2efcf13803ea6f','master','kde/applications*: update to 18.12.3 (!274)\n\n[ci:skip-build]: ollieparanoid made sure that this builds for all\n                 arches\n','DONE'),(63,'8b9998fc64c46322523e7d1f89ac9cd5d4c7a0b4','master','unity8/mir: update to 1.1.2, update related pkgs (!276)\n\nMir 1.1.2 builds without any out-of-tree patches, which is great.\nI\'ve updated a few other unity8-related packages too.\n\n[ci:skip-build]: ollieparanoid made sure, that everything builds.\n','DONE'),(64,'9c04dc4a1be8e73040327e8a386656836cacb4a0','master','kde/kwin: add patch to handle fbdev properly (!279)\n\nThis patch applies commit 93b7eea67db418751e7fe4a86bc19430c153588b\nfrom upstream kwin. Remove this patch once kwin stable used by\npostmarketOS will include the upstream commit.\n\n[ci:skip-build]: already built successfully\n','FAILED'),(65,'2a0dcdac5ab5905489736e81d55268fef46c4b10','master','kde/frameworks*: update to 5.56 (!275)\n\nBuilt and tested on x86_64.\n\n[ci:skip-build]: ollieparanoid made sure that this builds for\n                 x86_64, aarch64, armhf, armv7\n','FAILED'),(66,'eebeb32a6c8c125ec0538f38a5aae919d2aef89a','master','device-nokia-n900: Increase simple terminal font size to 12 (!280)\n\nAlso hardcode st instead of i3-sensible-terminal, because the font\nparameter may not work with all terminals, and we want to use st on the\nn900 anyway.\n','FAILED'),(67,'2651b565e0625350562de965c1f9dbbfd383a069','master','linux-ouya-ouya-mainline: Update kernel (!281)\n\n- Initial memory frequency scaling driver\n- Enable eMMC 1.8v DDR signaling mode\n- Limit CPU frequency to avoid overheating\n- Fix crash in xf86-video-opentegra driver\n\n[ci:skip-build]: already built successfully in CI\n','FAILED'),(68,'4c222eee7b41964c8a1cb8c2b3b4391da65feb15','master','main/postmarketos-ui-i3wm: Added xinput dependency (!282)\n\nThis adds the missing xinput dependency that\'s needed for lock.sh\n','FAILED'),(69,'def0dac79f81a9a4a865e7630a7111c47c637d88','master','kde/plasma*: update to 5.15.3 (!277)\n\nBuilt and tested on x86_64.\n\n[ci:skip-build]: ollieparanoid made sure that this builds for all\n                 arches\n','FAILED'),(70,'1672f9f5d300c2e350cdb8f3ae615524ee29bb55','master','samsung-lt01wifi: new device (Samsung Galaxy Tab 3 8.0) (!283)\n\n[ci:skip-build]: already built successfully in CI\n','FAILED'),(71,'0d966c7a6fe92486c5b9b8fe4525fef7f89c3a90','master','cross/musl-*: update to 1.1.21-r1\n','FAILED'),(72,'b6ec8550774471d049b3bbdf3486d8a4971d6b90','master','cross: add crossdirect package (!222)\n\nA set of wrapper executables that launch native cross compilers inside\nforeign chroots. Speeds up cross compilation a lot, compared to the\ndistcc-sshd method.\n','DONE'),(73,'32a6db0ca65fd701b01a16469b8a78644f04e193','master','temp/readline: remove (use upstream again)\n\nReadline has been upgraded in upstream, the original reason why it was\nforked is not necessary anymore. See:\nhttps://gitlab.com/postmarketOS/pmaports/issues/217#note_153463712\n','FAILED'),(74,'38dbafb98e2c751c112392ffa1dd05a4524b3b74','master','oneplus-one: fix swapped red and blue (!287)\n\nThe problem behind swapped red and blue is inverted byte order in\nframebuffer driver pixel format.\nThis patch sets the correct byte order in the framebuffer driver.\n\nThe previous workaround patch is removed because it fixes improperly\nthe red-screen issue, causing the swapped red and blue problem\nthat this commit solves\n\n[ci:skip-build]: already built successfully in CI\n','FAILED'),(75,'481bd4493bab51c3c87d512c0bc60b420fbcf072','master','asus-me176c: update kernel repository name (!251)\n\n[ci:skip-build]: building takes longer than one hour\n','DONE'),(76,'c6aae115982e6344c789d6506c06d17b3a49b697','master','cross/musl-*: update to 1.1.21-r2\n','DONE'),(77,'95198e12e93f50c35fca311c2eda21f4bb4e05d6','master','xiaomi-santoni: use msm-3.18 upstream kernel (!289)\n\ndevice-xiaomi-santoni: use mdss-fb-init-hack to refresh the display, and\nswapfile to fix \"out of memory\" when loading proprietary blobs.\n\nI have tested the kernel, USB Networking, Display, USB OTG, Wi-Fi (with\nproprietary blobs) works fine, through I haven\'t figured out how to get\nBluetooth and among of other stuff to work. Audio works. For more\ninformation on how to get Wi-Fi and Audio to work, check out the wiki\npage for this device, I have updated it.\n\n[ci:skip-build]: already built successfully in CI\n','FAILED'),(78,'874a309eedf2d93fb0f1241080ce479da0804e30','master','fairphone-fp2: fix swapped red and blue (!292)\n\nFixes the problem described in #211\n','DONE'),(79,'568e035837f7cdcde88daad2d7a4643b81f9be80','master','galaxy s relay support\n','DONE'),(80,'b19509a8fad2a3c11698d7049dbb8ec71d179b6b','master','motorola-montana: new device (Motorola Moto G5s) (!286)\n\nInitial starting point to get the device booting. The downstream kernel\nrepository can be improved, see discussion in the merge request.\n\n[ci:skip-build]: already built successfully in CI\n','DONE'),(81,'e3b1796552f7b5abf086acdec39d4439420ce6fb','master','kde/powerdevil: fix libexec install path (!293)\n\nChange the patch to reflect expected location in\nplasma-phone-components.\n\n[ci:skip-build]: already built successfully in CI\n','DONE'),(82,'1ee8db41dbda12c8084554a705db7075b14374fc','master','samsung-klte: fix swapped red and blue (!291)\n\nThe problem behind swapped red and blue is inverted byte order in\nframebuffer driver pixel format.\nThis patch sets the correct byte order in the framebuffer driver,\nsolving the swapped red and blue problem.\n\n[ci:skip-build]: already built successfully in CI\n','BUILDING'),(83,'97fd10aed4dc07d6d457a896c0afb6ecd14815ee','master','oneplus-bacon: fix incorrect framebuffer refresh rate in Xorg (!294)\n\nAfter this patch is applied, the phone boots in Xorg UIs like XFCE.\n\n[ci:skip-build]: already built successfully in CI\n','DONE'),(84,'40d110fcc9f50b02f6c2abe591cd36c4fec29ac0','master','Change default NetworkManager DHCP client to dhcpcd (!278)\n\nRemove the override in ouya-ouya (and in postmarketos-base) and add an\noverride for raspbery-pi3\n\nFixes #210\n','DONE'),(85,'f540943f0cb3775365faa1e06a36b2ae214d4d9b','master','main, unity8: bump pkgrels after boost upgrade\n\n$ pmbootstrap pkgrel_bump --auto\nIncrease \'libphonenumber\' pkgrel (5 -> 6), missing depend(s): so:libboost_system-mt.so.1.67.0, so:libboost_thread-mt.so.1.67.0\nIncrease \'unity-system-compositor\' pkgrel (0 -> 1), missing depend(s): so:libboost_system-mt.so.1.67.0\nIncrease \'trust-store\' pkgrel (0 -> 1), missing depend(s): so:libboost_filesystem-mt.so.1.67.0, so:libboost_program_options-mt.so.1.67.0, so:libboost_system-mt.so.1.67.0\nIncrease \'process-cpp\' pkgrel (0 -> 1), missing depend(s): so:libboost_iostreams-mt.so.1.67.0\nIncrease \'mir\' pkgrel (0 -> 1), missing depend(s): so:libboost_filesystem-mt.so.1.67.0, so:libboost_iostreams-mt.so.1.67.0, so:libboost_program_options-mt.so.1.67.0, so:libboost_system-mt.so.1.67.0\nIncrease \'location-service\' pkgrel (0 -> 1), missing depend(s): so:libboost_filesystem-mt.so.1.67.0, so:libboost_program_options-mt.so.1.67.0, so:libboost_system-mt.so.1.67.0\nIncrease \'ubuntu-download-manager\' pkgrel (0 -> 1), missing depend(s): so:libboost_log-mt.so.1.67.0, so:libboost_program_options-mt.so.1.67.0, so:libboost_system-mt.so.1.67.0, so:libboost_thread-mt.so.1.67.0\nIncrease \'dbus-cpp\' pkgrel (0 -> 1), missing depend(s): so:libboost_filesystem-mt.so.1.67.0, so:libboost_program_options-mt.so.1.67.0, so:libboost_system-mt.so.1.67.0\n\n[ci:skip-build]: I doubt that this would finish in time\n','INDEXING'),(86,'9bf7948303c44d0023a2f253ed5e1d1687d095e9','master','ccache-cross-symlinks: all arches, relative, clang (!299)\n\nCreate symlinks for all supported arches (armhf, armv7, aarch64, x86_64,\nx86), not only armhf and aarch64. Skip creating symlinks for the arch\nthat the package gets built for, so we can include x86_64 in the list\nwithout conflicting with the ccache package from Alpine.\n\nLink to ../../../bin/ccache instead of /usr/bin/ccache, so it works\nproperly with crossdirect (where we mount the native chroot to /native\nin the foreign chroot).\n\nAdd symlinks for clang and clang++.\n','INDEXING'),(87,'39971739fa015ebb511be34b1e62736a18f7f4c9','master','surftab-wintron7.0: new device (TrekStor Surftab wintron 7.0) (!290)\n\nThis device is x86_64 and has a 32-bit UEFI, so I need to install\n32-bit grub (AFAIK it\'s the only bootloader capable of loading a 64-bit\nkernel from 32-bit).\n\nThe grub-efi-x86 package has been generated with pmbootstrap.\n','DONE'),(88,'8a22cce65e0ba4ebdd118542165ad4ee13494e41','master','coreapps/*: update to 2.5.0 (!296)\n\n[ci:skip-build]: already built successfully in CI\n','DONE'),(89,'6e3252e40151f4b38483b2cacc8f15f9bb6b9e5e','master','CI: disable crossdirect for now (!301)\n\nDisable it, until more bugs are ironed out (see pmaports issues,\neverything related to crossdirect that is still open). Will be enabled\nagain soon.\n','BUILDING'),(90,'fb784b6236899039f555a92810ccc14583164c8f','master','hybris/*: enable building for armv7 (!297)\n\n[ci:skip-build]: simple arch change, building will probably take too\n                 long\n','DONE'),(91,'3928475fd62b40fe08a4b6266f62921b785f9784','master','CI: upstream compatibility: add grub-efi-x86 (!302)\n\nMake sure we keep it in sync with Alpine\'s version.\n','DONE'),(92,'7e742e2ca3cb4a417dfd935cd3546741c578f16e','master','firmware/firmware-aosp-broadcom-wlan: add armv7 arch (!303)\n','INDEXING'),(93,'e4aa322e33802c128fdb4a66a10cfdb96c03df71','master','htc-ace: switch to armv7 (!304)\n\nSwitches htc-ace to armv7. I was able to boot to xfce and everything\nseemed to work fine.\n\n[ci:skip-build]: already built successfully in CI\n','DONE'),(94,'1c4980bda59b5005e9c0e321dc2083e5ef873013','master','htc-m7: new device (HTC One M7) (!306)\n\nusb networking works\n\necho 100 > /sys/devices/platform/msm_fb.590593/leds/lcd-backlight/brightness\ncat /sys/devices/virtual/graphics/fb0/modes > /sys/devices/virtual/graphics/fb0/mode\n\nto get screen working\n\n[ci:skip-build]: already built successfully in CI\n','DONE'),(95,'2e9beef9f244c6dbb8e7eb848057f704a3e43523','master','samsung-i9003: support gcc8 (!307)\n\nThis patch forces the kernel to compile with gcc8 and includes by\ndefault INSTALL_MOD_STRIP=1.\n','DONE'),(96,'de7e9c14560d4957511281d60113389a3697f75b','master','kde/kcalcore: rebuild after soname bump\n\nmissing depends: so:libical.so.2, so:libicalss.so.2, so:libicalvcal.so.2\n','BUILDING'),(97,'40c126b92500cf039b92932cfe1318cf0962a71e','master','kde/plasma*: upgrade to 5.15.4 (!298)\n\n[ci:skip-build]: ollieparanoid made sure that this builds for x86_64,\n                 armhf, armv7, aarch64\n','BUILDING'),(98,'467338098ef0b363579a218b4fc9a7c6c85e7740','master','temp/libical: fix db.h: No such file or directory\n\nFix kcalcore build error. The same fix has been submitted to Alpine.\n\nIn file included from /home/pmos/build/src/kcalcore-18.12.3/src/icalformat.cpp:45:\n/usr/include/libical/icalss.h:492:10: fatal error: db.h: No such file or directory\n #include <db.h>\n          ^~~~~~\n\nRelated:\n* https://gitlab.com/postmarketOS/pmaports/issues/229\n* https://github.com/alpinelinux/aports/pull/6986\n','DONE'),(99,'9b6ea60690a0c07bd742df8b813b44345bff6bd9','master','cross/musl-*: update to 1.1.22-r0\n','DONE'),(100,'9b88689b9d3f6c7b9c4cdadb78f40f7c6817e497','master','new device: device-pine-dontbeevil (Don\'t be evil devkit) (!308)\n\nUART and SSH work and HDMI works in u-boot (just like the pine-a64lts).\nIt should work now with display and xorg/weston works directly after\ninstalling. Plasma mobile doesn\'t work directly because both kms and\nfbdev are enabled and kms doesn\'t work yet.\n\nlinux-postmarketos-allwinner: update to 5.0.0-rc3 with patches for this\ndevkit, tested on this device and on pinea64lts (the only other device\nusing the allwinner kernel).\n\n[ci:skip-build]: won\'t finish in time\n','DONE'),(101,'a169c1335a0bc70087c84c77575cef0f83645b48','master','all: remove install scripts from source (!310)\n','BUILDING'),(102,'24814b2ccb37d5623cdd18c5c2dff1cdc1a2fc32','master','libvdpau-tegra: Fix drawing problems on tegra30 (!311)\n','BUILDING'),(103,'77706b3b7395f6902efcc6d5ab61f78930df2fa9','master','temp/jemalloc: Import jemalloc from upstream aports unmaintained repo (!312)\n\nTaken from upstream aports @ 7af8be0e7aab4a5fe4315fb162850fad66aa7cb0\n','DONE'),(104,'eadb61205eaaf878d69f73c12f324885bca830f3','master','device-samsung-herolte: new device (Samsung Galaxy S7) (!314)\n\nThis is basically just the packages for the Galaxy S7 Edge (hero2lte).\nI only needed to change a few Kernel config options, so that the\ncolors are displayed correctly. The options regarding\nCONFIG_PANEL_S6E3HF4_WQHD and CONFIG_PANEL_S6E3HA3_DYNAMIC probably\nsolve this issue, but I modified the other options as well. I got the\ndifferences by diffing:\narch/arm64/configs/exynos8890-{hero2lte,herolte}_defconfig\n\nBooting, USB networking and the display work! I can\'t say anything about\nflashing via heimdall as this tool scares me. Following what WilliamO7\nwrote on the device page, I flashed it by sideloading the android\nrecovery zip.\n\n[ci:skip-build]: already built successfully in CI\n','BUILDING'),(105,'6b9ef9fda0e13cdfd18dc8e484ad5dc9c3532f33','master','nokia-n900: The power button suspends the device in i3. (!313)\n\nWith this patch the power button (the one you use to turn it on)\nsuspends the device. This should allow to save more energy with respect\nto just turning the screen off (slider button).\n\nI tested myself on Nokia N900.\n\n[ci:skip-build]: already built successfully in CI\n','DONE'),(106,'2c07f28419c0e85cd8b8939b8969b18c37fbd1f1','master','cross/crossdirect: use qemu when linking (!318)\n\nCross linker (e.g. ld from binutils-armhf) does not support any method\nof setting additional link paths, and this causes problems when building\nvarious packages. Work around this problem by calling the qemu binary\ninstead of the cross binary from the native chroot, whenever we are\nlinking.\n\nI have tested that this allows successfully building hello-world,\ncoreinfo, libhybris for armhf. So this fixes #227 and fixes #228.\n\nRegarding performance, this is the same way as distcc does it. We would\nget a performance gain if we were able to use the cross-linker. But so\nfar I could not figure out how to patch the binutils source to make it\nwork like we want to have it. Maybe I\'ll ask on some binutils mailing\nlist for advice. In the meantime, this workaround should make\ncrossdirect work for all use-cases, and it is still faster than the\nprevious distcc setup, because we can avoid the overhead of setting up\nand running a ssh server locally to work around missing authentication\nin distcc (see pmbootstrap!1649). Let\'s test this for some more time,\nand then make a pmbootstrap release that rolls out crossdirect for\neveryone.\n','DONE'),(107,'1031ff82a616de791484c93a650acb76f42905d8','master','CI: enable crossdirect again\n\nAll bugs should be ironed out now. Let\'s get some more testing by\nenabling crossdirect in CI again. The crossdirect feature is still only\nin pmbootstrap master, not in the latest pmbootstrap release. But if it\nworks without problems for some time, we\'re ready to make a release.\n\nThis reverts commit 6e3252e40151f4b38483b2cacc8f15f9bb6b9e5e.\n','DONE'),(108,'8a58003d56654ba50bd93d28f199178312d404cd','master','samsung-herolte: fix wifi firmware path (!316)\n\nThis patches the path that the kernel tries to load the Wifi chip\'s\nfirmware from. If someone with an Galaxy S7 Edge would test this -\nalthough I have no reason to believe that it would not work on the Edge\n- then this patch could also be applied to the linux-samsung-hero2lte\npackage.\n\n[ci:skip-build]: already built successfully in CI\n','DONE'),(109,'de6252570881fb9eca4a81180de1160ef9444220','master','temp/lightdm: remove (!319)\n\nPull request was merged upstream\n','BUILDING'),(110,'3d0b44ddede74ff6ff88ca410823cb732b34f2da','master','kde/frameworks*: update to 5.57 (!317)\n\nBuilt and tested on x86_64, everything works as expected.\n\n[ci:skip-build]: ollieparanoid made sure, that this builds for all\n                 relevant arches. With crossdirect, so that means it is\n                 pretty stable now \\o/\n','BUILDING'),(111,'4c429925329a765778ecf33bd3947954f9a8d83f','master','main/postmarketos-artwork-wallpapers: new wallpaper (!320)\n\nUse new wallpaper instead of the old one, and only install one wallpaper\nfile.\n','DONE'),(112,'db9611cdab2aaeda9cd360efe1b56947f76f6f3a','master','py3-brotlipy: bump pkgrel after soname bump\n\nLibrary doesn\'t exist anymore, so we need to rebuild the package:\nso:libpython3.6m.so.1.0\n','DONE'),(113,'5aa8866347563d9578ab0aa8ac49a58bf9dfa8d6','master','android-recovery-installer: Use an explicit list of zip file contents (!324)\n\nThe working directory can contain other files. For example pmbootstrap uses\nthe same directory for generating android recovery zip files. Extra files\ncan end up being archived into the recovery zip.\n\nThis change explicitly passes the list of files to be archived.\n','INDEXING'),(114,'9353bca73f66653de67b51c05e7ea4bc0dd36236','master','pine-dontbeevil: various dtb improvements (!323)\n\n* Created seperate DTB for the devkit named sun50i-a64-dontbeevil.dts so\n  it can easily be edited and the diff remains readable in gitlab\n* Added patch to build the new dtb\n* Added the ST LIS3MDL to the new dtb (Magnetometer)\n* Added the SensorTek STK3335 to the new dtb (Proximity and ambient\n  light sensor)\n* InvenSense MPU-6050 to the new dtb (Accelerometer and gyroscope)\n* Added CSI bus and OV5640 camera\n\nRemaining issues:\n* The STK3310 module doesn\'t load automatically\n* Camera doesn\'t want to capture but does show up as /dev/video0\n\n[ci:skip-build]: doesn\'t finish in time\n','DONE'),(115,'548e9465f962f4504a5c4a46c6fddb9304643093','master','samsung-herolte: add wifi firmware (!309)\n\nThis adds the required firmware to allow ip link set wlan0 up, which\nthen enables Samsung Hero-Devices, the Galaxy S7 (herolte) and the\nGalaxy S7 Edge (hero2lte), to connect to the Internet.\n','DONE'),(116,'28ab7dc9f3e39535fc9f025435c7cecb136c5061','master','linux-samsung-klte: base downstream kernel source on lineage-14.1 branch (!321)\n\n@drebrez originally based klte port on lineage-16.0 branch (Android 9),\nbut we need compatibility with Android 7.1, so use lineage-14.1 branch.\n\nAlso tidy up downstream kernel config a little bit (pass it through\npmbootstrap kconfig edit, change nothing, exit with saving).\n','BUILDING');
